import React from "react";
import Navbar from "react-bootstrap/Navbar";
import { BsFillPersonCheckFill } from "react-icons/bs";

const Nav = () => {
  return (
    <div>
      <Navbar className="bg-green-200" variant="light">
        <Navbar.Brand href="#home">
          <BsFillPersonCheckFill />
          React Bootstrap
        </Navbar.Brand>
      </Navbar>
    </div>
  );
};

export default Nav;
